import React, { Component } from 'react';
import './body.css';

class XD extends Component {
    render() {
        return (
            <div className="main">
                <h1 className="title">MIXED DOUBLES</h1>
                <h2 className="rankTitle">RANKINGS</h2>
                <h2 className="rankTitle">GAMES</h2>
            </div>
        );
    }
}

export default XD;
